import React, { Component } from 'react';
import { Row, Col } from 'antd';
import Button from 'antd/es/button';

class Login extends Component {
    render() {
        return (
            <div className="App">
                Login

                <br />
                <br />
                <Button type="primary" block>Sign In with Personal Email</Button>

                <br />
                <br />
                <br />
                <Button type="primary" block>Sign In with Google Account</Button>

            </div>
        );
    }
}

export default Login;
